import { Link } from "react-router-dom";
import { Component } from "react";
import axios from "axios";
import Cat from "../../Components/Cat/Cat";
import "./Cats.scss";

const origin = "http://localhost:9001";

class Cats extends Component {
  state = {
    catsList: [],
  };

  componentDidMount() {
    axios.get(`${origin}/cats`).then((response) => {
      this.setState({ catsList: response.data });
    });
  }
  render() {
    const { catsList } = this.state;
    return (
      <div className="catss">
        <Link to={`/cats/add`} className="catss__link">
          Upload{" "}
        </Link>

        <ul className="catss__cats">
          {catsList.map((cat) => {
            return (
              <li className="cats__cat">
                <Cat
                  key={cat.id}
                  id={cat.id}
                  name={cat.name}
                  image={cat.image}
                  age={cat.age}
                />
              </li>
            );
          })}
        </ul>
      </div>
    );
  }
}
export default Cats;
